import React from "react"

function handleChange(){
  alert("Change!")
}

function TodoItem(props){
    return(
    <div className="todo-item">

      <input type="checkbox" onChange={handleChange} checked={props.it.completed}/>
      <p>{props.it.text}</p> 

    </div>
    )
}

export default TodoItem
